import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate, BrowserRouter } from 'react-router-dom';
import { HelmetProvider } from 'react-helmet-async';
import ProductList from './Product/ProductList';
import ProductCreation from './Product/ProductCreation';
import ProductDetail from './Product/ProductDetail';
import Login from './Register/Login';
import Register from './Register/Register';








function App() {
    return (
        <Router>
                        <ToastContainer theme='dark' position='bottom-center' transition={Bounce} />
                        <Routes>
                            <Route path="/" element={<Login />} />
                            <Route path="/register" element={<Register />} />
                            <Route path="/home" element={<Protectedroute><ProductList /></Protectedroute>} />
                            <Route path="/create" element={<Protectedroute><ProductCreation /></Protectedroute>} />
                            <Route path="/product/:id" element={<Protectedroute><ProductDetail /></Protectedroute>} />

                        </Routes>


        </Router>
    );
}

export default App;
